import { Col, Image, Row, Space, Typography } from 'antd';
import React from 'react';
import { API_KEY } from '../../constants/api-keys';

function CurrentlyPlayingList({ current }) {
	const { Title } = Typography;
	const imgUrl = API_KEY.IMAGE_URL;
	// console.log(current);
	return (
		<Col span={24}>
			<Image width={200} src={`${imgUrl + current.poster_path}`} />
			<Space>
				<Title level={4}>{current.title}</Title>
			</Space>
		</Col>
	);
}

export default CurrentlyPlayingList;
